Debugger Frame
================

Frame Manager For Debugger

Usage
-------

```js
var Frames = require('debugger-frame');


var frames = new Frames(connection);


frames.on('change', function(frameItems) {
  console.log(frameItems);   // => [{blabla}, {}]
  console.log(frames.getItems() === frameItems);  // => true
});

```
